import React from 'react';
import { Component } from "react";
import { Link } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';


import MenuRoutes from "./MenuGlobRoutes"


interface Props {
};

interface State {
}


class MenuGlob extends Component<Props, State> {

    constructor(props: Props) {
        super(props);
    }

    render() {
        return (

            <BrowserRouter>
                <div>

                    <p>Wybierz interesujący Cię przykład:</p>

                    <Container fluid>

                        <Row>
                            <Col> <Link to='/'>Pierwsza aplikacja (wypisanie tekstu)</Link> </Col>
                            <Col> <Link to='/RadiobuttonForm'>Wybór "jeden z wielu"</Link> </Col>
                            <Col> <Link to='/DatabaseApp'>DatabaseApp</Link> </Col>
                        </Row>
                        <Row>
                            <Col> <Link to='/CounterApp'>Licznik (obsługa przycisków) </Link> </Col>
                            <Col> <Link to='/CheckboxForm'>Wybór "kilka z wielu"</Link> </Col>
                            <Col> <Link to='/DataBasePerson'>DataBasePersonREST</Link> </Col>
                        </Row>
                        <Row>
                            <Col> <Link to='/MyComponentLife'>Życie komponentu</Link>   </Col>
                            <Col> <Link to='/ManyElemForm'>Kilka elementów</Link> </Col>
                            <Col> <Link to='/AppStorage'>Demonstracja lokalnego magazynu</Link> </Col>
                        </Row>
                        <Row>
                            <Col> <Link to='/NameForm'>Wprowadzanie tekstu jednolinijkowego</Link> </Col>
                            <Col> <Link to='/ManyElemFormValid'>"Ręczna" walidacja kilku elementów</Link> </Col>
                            <Col> <Link to='/BankTrans'>BankTransREST</Link> </Col>
                        </Row>

                        <Row>
                            <Col> <Link to='/DNameForm'>Wprowadzanie dwóch tekstów jednolinijkowych</Link> </Col>
                            <Col> <Link to='/MyFormikYup'>Walidacja kilku elementów za pomoców Formika</Link> </Col>
                            <Col> <Link to='/BPersonDatabase'>BPersonDatabase</Link> </Col>
                        </Row>

                        <Row>
                            <Col> <Link to='/TextAreaForm'>Wprowadzanie tekstu wielolinijkowego</Link> </Col>
                            <Col> <Link to='/TwoWindows'>Demo okna modalnego</Link>  </Col>
                            <Col> <Link to='/BootstrapDemo'>BootstrapDemo</Link> </Col>
                        </Row>

                        <Row>
                            <Col> <Link to='/ListForm'>Wybór z listy</Link> </Col>
                            <Col> <Link to='/LoginWindow'>LoginWindow</Link> </Col>
                            <Col> <Link to='/BookApp'>BookApp</Link> </Col>
                        </Row>

                    </Container>

                    <hr />
                    <MenuRoutes />
                    <hr />
                </div>
            </BrowserRouter>
        );

    }
}

export default MenuGlob;
